        method: 'GET',
        headers: {
            Accept: 'application/json',
                    'Content-Type': 'application/json',
        },
        body: JSON.stringify(this.state)
    }).then(response => {
            setCount(response);
        })
        .catch(error =>{
            console.log(error);
        })
    
}
}
function Middle() {
    // Declare a new state variable, which we'll call "count"
  
